description:
Disney Kurt Russell live-action classic
1969 
Disney Miniseries called &quot;The Secret Of Boyne Castle&quot;
Theatrically released as &quot;Guns in the Heather&quot;
1980's The Wonderful World Of Disney broadcasted as &quot;The Spybusters&quot;

This is a re-edit of the 1980's WWoD broadcast to crop out WWoD titles and remove damage edges in an attempt to get as close to the theatrical release as possible for posterity.  Please seed.  If anyone finds a true copy (no Disney watermark), please add link to it in the comments.

Two screen-sizes in file: [720x480] &amp; [426x649]
